  render() {
    return (
      <div className="App">
        My Hello World


        <FirstComponent></FirstComponent>
        <SecondComponent></SecondComponent>
        <ThirdComponent></ThirdComponent>

      </div>
    );
  }
}

// Class Component
// extend the Component class and call the render function


